#input: list of numbers can be ascii values or string
#encoded_output: list of number


def mtfEncoding(data):
    buffer=[i for i in range(256)]
    dataLength  = len(data)
    def value():
        for i in range(dataLength):
            ascii = data[i] #ord(data[i])
            pos=buffer.index(ascii)
            char =buffer.pop(pos)
            buffer.insert(0,char)
            yield pos.to_bytes(1, 'big')
    return b''.join(value())

def mtfDecoding(data):
    buffer=[i for i in range(256)]
    code = []
    data = list(map(int, data))
    for i in range(0, len(data)):
        pos=buffer[int(data[i])]
        mtf = buffer.pop(int(data[i]))
        buffer.insert(0, mtf)
        #code.append(bytes(chr(pos),'utf-8'))#char)
        code.append(pos)
    return code

